garten, fifth grade, eighth grade, nonparental care, child care, after-school care, before-school care, elementary school, early childhood, parent involvement, academic achievement, standardized assessment, reading, mathematics, science, physical development, cognitive development, social development, special education',-68400,'No',NULL,'catalog_type_data_apps','a:4:{s:19:\"field_ctda_app_type\";a:1:{i:0;a:1:{s:5:\"value\";s:9:\"Data Site\";}}s:27:\"field_ctda_catalog_location\";a:1:{i:0;a:1:{s:5:\"value\";s:8:\"External\";}}s:24:\"field_ctda_datasets_used\";a:1:{i:0;a:1:{s:5:\"value\";s:34:\"Early Childhood Longitudinal Study\";}}s:19:\"field_ctda_language\";a:1:{i:0;a:1:{s:5:\"value\";s:7:\"English\";}}}',6015,'access_type_embed_link','a:1:{s:23:\"field_atel_access_point\";a:1:{i:0;a:3:{s:3:\"url\";s:52:\"http://nces.ed.gov/pubsearch/getpubcats.asp?sid=024#\";s:5:\"title\";N;s:10:\"attributes\";s:6:\"a:0:{}\";}}}',6017,NULL,NULL,NULL,'Create','OGPL-DMS-edu-ds@data.gov','http://nces.ed.gov/ecls/dataproducts.asp',NULL,'a:0:{}',1),(602,195,NULL,NULL,NULL,'6b8e605f62945dc701d29ea98eb07a15<=>132793775',NULL,NULL,'Personnel Trends by Gender/Race','<p>Number of Service members by Gender, Race, Branch.</p>',180,'GSD','Airlines ','aIR','John Doe','Data Analyst','200 Beta Drive','000-000-0000',NULL,'Demographic, Services, Military, DoD, Personnel, Army, Navy, Marine Corp, Air Force, Reserve, Guard, Race, Gender, Sex, Ethnicity, Officer, Enlisted, Warrant, American Indian, Alaskan Native, Asian, Black, Multi, Hawaiian, Pacific, Islander, White, Hispan',-68400,'No',NULL,'catalog_type_raw_data','a:5:{s:32:\"field_ctrd_bibliography_citation\";a:1:{i:0;a:1:{s:5:\"value\";N;}}s:27:\"field_ctrd_catalog_location\";a:1:{i:0;a:1:{s:5:\"value\";s:8:\"External\";}}s:31:\"field_ctrd_category_designation\";a:1:{i:0;a:3:{s:4:\"type\";N;s:5:\"value\";N;s:7:\"item_id\";N;}}s:29:\"field_ctrd_dataset_group_name\";a:1:{i:0;a:1:{s:5:\"value\";N;}}s:20:\"field_ctrd_frequency\";a:1:{i:0;a:1:{s:5: