ld_atel_access_point\";a:1:{i:0;a:3:{s:3:\"url\";s:55:\"http://www.dlis.dla.mil/webflis/pub/pub_search_BSM.aspx\";s:5:\"title\";N;s:10:\"attributes\";s:13:\"s:6:\"a:0:{}\";\";}}}',835,NULL,NULL,NULL,'Create','OGPL-DMS-def-ds@data.gov','http://www.dlis.dla.mil/webflis/',NULL,'a:0:{}',1),(628,198,NULL,NULL,NULL,'c2d3b70fb8a896a6b293b80c98fe8465<=>322077924',NULL,NULL,'The Pentagon Channel - Armed with Science: Research and Applications for the Modern Military audio podcast','<p>A weekly audio podcast that discusses the importance of science and technology to military operations and the Department of Defense. Each week, scientists, administrators, and operators discuss cutting-edge scientific research and development sponsored by defense offices. Armed with Science is a product of the Assistant Secretary of Defense for Public Affairs, Defense Media Activity, Emerging Media Directorate.</p>',180,'GSD',NULL,NULL,'Jane Doe','Data Analyst','200 Beta Drive','000-000-0000',NULL,'DoD, Defense, Defence, Army, Navy, Air Force, Marines, Marine Corps, Coast Guard, USN, USAF, USMC, USCG, military, soldier, news, pentagon, audio, podcast, Pentagon Channel, Armed with Science: Research and Applications for the Modern Military, science, technology, development, researcher, scientist, social media, blogger',-68400,'No',NULL,'catalog_type_data_apps','a:4:{s:19:\"field_ctda_app_type\";a:1:{i:0;a:1:{s:5:\"value\";s:3:\"RSS\";}}s:27:\"field_ctda_catalog_location\";a:1:{i:0;a:1:{s:5:\"value\";s:8:\"External\";}}s:24:\"field_ctda_datasets_used\";a:1:{i:0;a:1:{s:5:\"value\";s:20:\"The Pengaton Channel\";}}s:19:\"field_ctda_language\";a:1:{i:0;a:1:{s:5:\"value\";s:7:\"English\";}}}',6019,'access_type_embed_link','a:1:{s:23:\"field_atel_access_point\";a:1:{i:0;a:3:{s:3:\"url\";s:72:\"http://www.pentagonchannel.mil/podcast/xml/PC_Audio_ArmedwithScience.xml\";s:5:\"title\";N;s:10:\"attributes\";s:6:\"a:0:{}\";}}}',6020,NULL,NULL,NULL,'Create','OGPL-DMS-def-ds@data.gov','http://www.pentagonchannel.mil/podcast.shtml',NULL,'a:0:{}',1),(644,199,NULL,NULL,NULL,'5de18df1fb00f94d66508c1bdf0949da<=>116400697',NULL,NULL,'Federal Fleet Data','<p>Agencies annually report motor vehicle fleet data using the Federal Automotive Statistical Tool (FAST), a web-based reporting tool cosponsored by GSA and the Department of Energy. The annual Federal Fleet Report publishes motor vehicle fleet inventory, cost, and use data from these annual submissions, and the resulting data tables are available in these datasets. While GSA is working to improve the quality and reliability of the Federal Fleet Report, some categories contained within the Report are undefined or unclear, and the data is susceptible to coding errors, flaws and omissions. For example, the term \"limousine\" is not defined. Vehicles represented as limousines can range from protective duty vehicles to common sedans, and many of these vehicles serve in a law enforcement or protective capacity. Additionally, the Fleet Report acquisition data reflects vehicles that were delivered during the fiscal year, not vehicles that were ordered. For example, vehicles noted in the Fiscal Year 2009 Fleet Report would have been funded and ordered in Fiscal Year 2008. The May 2011 Presidential Memorandum on Federal Fleet Performance directs GSA to work with agencies to improve Federal fleet performance, including motor vehicle data. GSA looks forward to implementing improvements to ensure the accuracy and completeness of agency motor vehicle inventories and data systems. This data is vital for agencies to right-size their fleet, and can serve as a useful tool to help agencies achieve cost and energy savings as directed by the Presidential Memorandum.</p>',180,'GSD',NULL,NULL,'John Doe','Data Analyst','200 Beta Drive','000-000-0000',NULL,'fleet report, federal fleet, federal fleet report, motor vehicles, motor vehicle fleet, fleet inventory, fleet cost, fleet utilization, FAST, FAST report, vehicle utilization, vehicle cost, vehicle inventory',-68400,'No',NULL,'catalog_type_raw_data','a:5:{s:32:\"field_ctrd_bibliography_citation\";a:1:{i:0;a:1:{s:5:\"value\";N;}}s:27:\"field_ctrd_catalog_location\";a:1:{i:0;a:1:{s:5:\"value\";s:8:\"External\";}}s:31:\"field_ctrd_category_designation\";a:1:{i:0;a:3:{s:4:\"type\";N;s:5:\"value\";N;s:7:\"item_id\";N;}}s:29:\"field_ctrd_dataset_group_name\";a:1:{i:0;a:1:{s:5:\"value\";N;}}s:20:\"field_ctrd_frequency\";a:1:{i:0;a:1:{s:5:\"value\";s:6:\"annual\";}}}',777,'access_type_downloadable','a:4:{s:22:\"field_atd_access_point\";a:1:{i:0;a:3:{s:3:\"url\";s:38:\"http://www.gsa.gov/dg/FedFleetData.zip\";s:5:\"title\";N;s:10:\"attributes\";s:13:\"s:6:\"a:0:{}\";\";}}s:27:\"field_atd_compressed_format\";a:1:{i:0;a:1:{s:5:\"value\";s:3:\"Yes\";}}s:21:\"field_atd_file_format\";a:1:{i:0;a:1:{s:5:\"value\";s:3:\"XLS\";}}s:19:\"field_atd_file_size\";a:1:{i:0;a:1:{s:5:\"value\";s:3:\"1.4\";}}}',778,NULL,NULL,NULL,'Create','OGPL-DMS-pmo@data.gov','http://www.gsa.gov/vehiclepolicy',NULL,'a:0:{}',1),(654,200,NULL,NULL,NULL,'63b07e828bf016e976ff95d6ee07a105<=>114467860',NULL,NULL,'USA Spending Contracts and Purchases','<p>Provides US Federal Spending by agency. The Contracts section allows searching for data relating to all Federal contracts. There are three main categories of searches: by contractor, by location, and by contracting agency. The Purchase section allows users to view purchase cards spending of various federal agencies for each fiscal year. The data available on this website are extracted from the report published once every quarter on the GSA SmartPay website. The GSA SmartPay receives this data directly from the banks that issued the purchase cards.</p>',180,'GSD',NULL,NULL,'Jane Doe','Data Analyst','200 Beta Drive','000-000-0000',NULL,'Federal contracts, Contracts, Awards, Grants, Loans, Assistance, Purchase Cards, GSASmartPay, GSA SmartPay, USASpending, USA Spending, Purchase, Travel, Fleet, contractor, contracting agency, American Recovery and Reinvestmen