NULL,NULL,1324732620,NULL,'The Visible Human Project','Presents complete, anatomically detailed, three-dimensional representations of the male and female human body for health professions education, treatment, and research. The Visible Human Project has its roots in the Library\'s 1986 Long-Range Plan. The plan recommended that NLM should \"...thoroughly and systematically investigate the technical requirements for and feasibility of instituting a biomedical images library.\" It encouraged the NLM to consider building and disseminating medical image libraries much the same way it acquires, indexes, and provides access to the biomedical literature. It foresaw a coming era where NLM\'s bibliographic and factual database services would be complemented by libraries of digital images, distributed over high-speed computer networks and by high-capacity physical media. Not surprisingly, it saw an increasing role for electronically represented images in clinical medicine and biomedical research. Early in 1989, under the direction of the Board of Regents, an adhoc planning panel was convened to explore the proper role for NLM in the rapidly changing field of electronic imaging. After much deliberation, the NLM Planning Panel on Electronic Image Libraries made the following recommendation: \"NLM should undertake a first project building a digital image library of volumetric data representing a complete, normal adult male and female. This Visible Human Project will include digitized photographic images for cryosectioning, digital images derived from computerized tomography and digital magnetic resonance images of cadavers.\" The Visible Human Project is acquiring images from representative male and female cadavers. A contract for acquisition of these data was awarded in August 1991 to the University of Colorado at Denver.',179,'Education Department',NULL,'Educate','Jone Doe ','Data Analyst ','100 Alpha Lane ','000-000-7890 ',NULL,'Transportation \r\n',1325307600,'No',NULL,'cata