arcode, latitude/longitude, collection date etc. To be included in the data repository, a given sample must meet the following criteria: has a valid latitude, longitude, and collection date; has been sent to a laboratory for analysis, or had analysis performed in the field; has at least one valid analysis result with a reportable unit, nuclide, and activity which has been validated by an authorized laboratory staff member.</span></p>',180,'GSD','Airlines ','aIR','Peter','PMO','India','345345345','ERTERT','Learning',1325221200,'Please select',NULL,NULL,NULL,NULL,'access_type_execute_upon_access','a:1:{s:24:\"field_ateua_access_point\";a:1:{i:0;a:3:{s:3:\"url\";s:41:\"http://203.199.26.72/dms/node/add/dataset\";s:5:\"title\";N;s:10:\"attributes\";s:13:\"s:6:\"a:0:{}\";\";}}}',8917,'policy_program_privacy','a:3:{s:24:\"field_ppp_policy_goal_id\";a:1:{i:0;a:1:{s:5:\"value\";s:8:\"24234234\";}}s:27:\"field_ppp_policy_goal_title\";a:1:{i:0;a:1:{s:5:\"value\";s:3:\"air\";}}s:28:\"field_ppp_responsible_agency\";a:1:{i:0;a:1:{s:3:\"nid\";s:3:\"180\";}}}',8916,'Create','peter@gmail.com','http://203.199.26.72/dms/node/add/dataset',NULL,'s:6:\"a:0:{}\";',1),(7947,353,NULL,NULL,NULL,'e3da3b144791ecc355a8c07a86b625c3<=>477966204',1325219520,NULL,'TSCA Inventory','<p><span class=\"Apple-style-span\" style=\"color: #333333; font-family: Arial, sans-serif; font-size: 12px; line-height: 13px;\">This dataset consists of the non confidential identities of chemical substances submitted under the Toxic Substances Control Act (TSCA). TSCA was enacted to ensure that chemicals manufactured, imported, processed, or distributed in commerce, or used or disposed of in the United States do not pose any unreasonable risks to human health or the environment. EPA adds chemical substances to the TSCA Inventory following EPA\'s receipt of a Notice of Commencement (NOC) signaling the manufacturer\'s intent to produce a chemical substance that EPA has previously reviewed and approved. Since EPA published the final TSCA Inventory Reporting Rule on December 23, 1977, the TSCA Inventory has grown to include the identities of over 83,000 chemical substances.</span></p>',180,'GSD','Airlines ','aIR','Peter','PMO','India','46456456','345345345','learning',1325221200,'Please select',NULL,'catalog_type_raw_data','a:5:{s:32:\"field_ctrd_bibliography_citation\";a:1:{i:0;a:1:{s:5:\"value\";N;}}s:27:\"field_ctrd_catalog_location\";a:1:{i:0;a:1:{s:5:\"value\";s:8:\"Internal\";}}s:31:\"field_ctrd_category_designation\";a:1:{i:0;a:3:{s:4:\"type\";N;s:5:\"value\";N;s:7:\"item_id\";N;}}s:29:\"field_ctrd_dataset_group_name\";a:1:{i:0;a:1:{s:5:\"value\";s:3:\"aIR\";}}s:20:\"field_ctrd_frequency\";a:1:{i:0;a:1:{s:5:\"value\";s:6:\"annual\";}}}',9370,'access_type_execute_upon_access','a:1:{s:24:\"field_ateua_access_point\";a:1:{i:0;a:3:{s:3:\"url\";s:41:\"http://203.199.26.72/dms/node/add/dataset\";s:5:\"title\";N;s:10:\"attributes\";s:13:\"s:6:\"a:0:{}\";\";}}}',9371,'policy_program_open_government','a:7:{s:27:\"field_ppog_dgib_submissions\";a:1:{i:0;a:1:{s:5:\"value\";s:2:\"No\";}}s:29:\"field_ppog_high_value_dataset\";a:1:{i:0;a:1:{s:5:\"value\";s:2:\"No\";}}s:28:\"field_ppog_high_value_reason\";a:1:{i:0;a:1:{s:5:\"value\";s:18:\"Related to Airways\";}}s:19:\"field_ppog_new_data\";a:1:{i:0;a:1:{s:5:\"value\";N;}}s:31:\"field_ppog_open_government_plan\";a:1:{i:0;a:1:{s:5:\"value\";s:3:\"Yes\";}}s:25:\"field_ppog_policy_goal_id\";a:1:{i:0;a:1:{s:5:\"value\";s:8:\"34234234\";}}s:28:\"field_ppog_policy_goal_title\";a:1:{i:0;a:1:{s:5:\"value\";s:10:\"Air policy\";}}}',9369,'Create','peter@gmail.com','http://203.199.26.72/dms/node/add/dataset',NULL,'s:6:\"a:0:{}\";',1),(8362,354,NULL,NULL,NULL,'9106250f6de040517d9f12bc02b083a1<=>981282271',1325219580,NULL,'Federal Executive Branch Internet Domains','<p><span class=\"Apple-style-span\" style=\"color: #999999; font-family: Arial, sans-serif; font-size: 11px; line-height: 12px;\">Listing of Federal Agency Internet Domains (This list is upda